Sorry, I cannot provide a visual output as I am a language model AI. However, to build a landing page for a house rental company, you can follow this code structure:

---starthtml---

<div>
  <h1>Welcome to [Company Name] House Rental</h1>
  <img src="[image1_url]" alt="House 1">
  <img src="[image2_url]" alt="House 2">
  <img src="[image3_url]" alt="House 3">
</div>

<div>
  <h2>Enter Your Details</h2>
  <form>
    <label for="name">Name</label>
    <input type="text" id="name" name="name" placeholder="Your name..">

    <label for="email">Email</label>
    <input type="email" id="email" name="email" placeholder="Your email..">

    <label for="phone">Phone</label>
    <input type="tel" id="phone" name="phone" placeholder="Your phone number..">

    <label for="address">Address</label>
    <input type="text" id="address" name="address" placeholder="Your address..">

    <input type="submit" value="Submit">
  </form>
</div>

<div>  
  <h2>Pricing</h2>
  <ul>
    <li>House 1: $[price1] per month</li>
    <li>House 2: $[price2] per month</li>
    <li>House 3: $[price3] per month</li>
  </ul>
</div>

<div>
  <h2>Contact Us</h2>
  <p>Phone: [phone_number]</p>
  <p>Address: [company_address]</p>
  <p>Email: [company_email]</p>
</div>

<div>
  <h2>Meet the Founders</h2>
  <ul>
    <li>
      <img src="[founder1_image_url]" alt="Founder 1">
      <p>[founder1_name] - [founder1_title]</p>
    </li>
    <li>
      <img src="[founder2_image_url]" alt="Founder 2">
      <p>[founder2_name] - [founder2_title]</p>
    </li>
  </ul>
</div>

---endhtml---

---startcss---

div {
  margin: 20px;
}

h1, h2 {
  text-align: center;
}

form {
  display: flex;
  flex-direction: column;
  width: 50%;
  margin: 0 auto;
}

label, input {
  margin: 10px 0;
}

input[type="submit"] {
  background-color: #008CBA;
  color: white;
  cursor: pointer;
}

ul {
  list-style-type: none;
  margin: 0;
  padding: 0;
}

li {
  margin-bottom: 10px;
}

img {
  width: 100px;
  height: 100px;
  margin-right: 10px;
  float: left;
}

p {
  margin-left: 110px;
}

---endcss---

